    false,nt"url": null,nt"notes": "This narrative report for Des Lacs & Lostwood
    Migratory Waterfowl Refuge outlines Refuge accomplishments from May through July
    of 1940. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, fish, and disease- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and wildfires. Resource management is outlined; topics include grazing
    and haying. The public relations section of the report describes Refuge visitors.
